// App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Home from './components/Home';  // Adjust the import path


function App() {
  return (
    <Router>
      <div>
        {/* Include your Navbar or any other global components */}
        <Navbar />

        {/* Define routes using the Routes component */}
        <Routes>
          {/* Home/Index Route */}
          <Route path="/" element={<Home />} />

          {/* Add more routes for other pages/components */}
          {/* <Route path="/about" element={<About />} /> */}
          {/* <Route path="/contact" element={<Contact />} /> */}

          {/* Handle 404 - Page Not Found */}
          <Route path="*" element={<NotFound />} />
        </Routes>
      </div>
    </Router>
  );
}

// A simple NotFound component for handling 404 errors
function NotFound() {
  return (
    <div>
      <h1>404 - Not Found</h1>
      {/* You can add a link to navigate back to the home page or another page */}
    </div>
  );
}

export default App;
